import React, { Component } from "react";
import { MenuItems } from "./MenuItems";
import { Button } from "../Button";
import "./Navbar.css";
import { Link, BrowserRouter, Route, Routes } from "react-router-dom";
import AddKyc from "../bank_home/add_kyc";
import ViewKyc from "../bank_home/view_kyc";
import ModifyKyc from "../bank_home/modify_kyc";

class Navbar extends Component {
  state = { clicked: false };

  handleClick = () => {
    this.setState({ clicked: !this.state.clicked });
  };

  render() {
    return (
      <nav className="NavbarItems">
        <h1 className="navbar-logo">
          KYC DAPP<i className="fab fa-ethereum"></i>
        </h1>
        <div className="menu-icon" onClick={this.handleClick}>
          <i
            className={this.state.clicked ? "fas fa-times" : "fas fa-bars"}
          ></i>
        </div>
        <ul className={this.state.clicked ? "nav-menu active" : "nav-menu"}>
          {MenuItems.map((item, index) => {
            return (
              <BrowserRouter>
                <li key={index}>
                  <Link className={item.cName} to={item.to}>
                    {item.title}
                  </Link>
                </li>
                <Routes>
                  <Route exact path="/addkyc" component={AddKyc} />
                  <Route path="/viewkyc" component={ViewKyc} />
                  <Route path="/modifykyc" component={ModifyKyc} />
                </Routes>
              </BrowserRouter>
            );
          })}
        </ul>
        <Button>Log out</Button>
      </nav>
    );
  }
}

export default Navbar;
